  ,PregnancyStatus        INTEGER 
  ,DueDate                VARCHAR(10)
  ,DataCollectionStage    INTEGER  NOT NULL
  ,DateCreated            VARCHAR(14) NOT NULL
  ,DateUpdated            VARCHAR(14) NOT NULL
  ,UserID                 INTEGER  NOT NULL
  ,DateDeleted            VARCHAR(30)
  ,ExportID               INTEGER  NOT NULL
);
